import React from 'react';
import HomePage from './pages/homepage/homepage'
import GlobalStyle from './globalStyles';
import {BrowserRouter as Router, Route} from 'react-router-dom'

function App() {
  return (
    <Router>
      <GlobalStyle/>
      <Route path="/" exact component={HomePage}/> 
    </Router>
  );
}

export default App;
